n = int(input())
a = [list(map(int, input().split())) for i in range(n)]
a.sort(reverse=True)

dp = [0] * 10
dp[0] = 1
for i in range(1, 10):
	ndp = [0] * 10
	for j in range(n):
		ndp[a[j][j]] += dp[j]
	dp = ndp

m = 0
for i in range(10):
	if dp[i] >= 9:
		m += 1

if m == 0:
	print(0)
else:
	print(m)
